from fontTools.ttLib import TTFont
import matplotlib.pyplot as plt
import time

total_data = {"08220675.woff": {}, '5f0be5ce.woff': {}, "8a16e02d.woff": {}, "c722c643.woff": {},
              "d2324528.woff": {}, "26454aeb.woff": {}, "b3b7ee0d.woff": {}, '7e941ac2.woff': {}, 'd2f7b57f.woff': {},
              "d308c5b0.woff": {}, '0bec55e0.woff': {}, "57ed9f2a.woff": {}, "95a89f18.woff": {}}


def getGlyphCoordinates(file_name):
    """
    获取字体轮廓坐标,手动修改key值为对应数字
    """
    font = TTFont(file_name)

    glyfList = list(font['glyf'].keys())
    data = dict()

    for key in glyfList:
        # 剔除非数字的字体
        if key[0:3] == 'uni':
            data[key] = list(font['glyf'][key].coordinates)

    return data


file_names = ['08220675.woff', '5f0be5ce.woff', '8a16e02d.woff', 'c722c643.woff', 'd2324528.woff', '26454aeb.woff',
              'b3b7ee0d.woff', '7e941ac2.woff', 'd2f7b57f.woff', "d308c5b0.woff", '0bec55e0.woff', "57ed9f2a.woff",
              '95a89f18.woff']
for file_name in file_names:

    fig = plt.figure()
    data = getGlyphCoordinates(file_name)
    i = 1
    for key, value in data.items():
        print(file_name)
        print(key, ":", value)
        total_data[file_name][key] = value
        plt.subplot(2, 5, i)
        x, y = [], []
        for new_x, new_y in data[key]:
            x.append(new_x)
            y.append(new_y)

        plt.plot(x, y)
        plt.savefig(file_name[:-4] + ".png")
        i += 1
    plt.title(file_name)
    plt.show()
for file_name, data in total_data.items():
    print(file_name, ":", data)
print(total_data)
